import React from 'react'
import styled from 'styled-components'
import Parallex from 'react-rellax'
import { Root } from './Root';


const Container = styled.div`
  width: 100%;
  height: 100vh;
  display: flex;
  background-image: linear-gradient(to bottom, #343b7c, #131424);
  overflow: hidden;
`;

const Left = styled.div`
  flex: 1;
  position: relative;
  
`;
const Info = styled.div`
  top: 10%;
  min-width: 100% ;
`;

const Title = styled.h1`
  font-size: 76px;
  margin: 0 0 0 70px;
  color: white;
`;

const Desc = styled.p`
  margin: 0 0 0 70px;
  width: 75%;
  color: white;
`;
const Right = styled.div`
  flex: 1;
  position: absolute ;
  right: 9% ;

`;


const Ourservice = () => {
  return (
    <Container>
        <Left>
          <Info>
            <Parallex speed={1}>
              <Title>Our Services</Title>
            </Parallex>
            <Parallex speed={2}>
              <Desc>
                Lorem ipsum dolor sit amet consectetur adipisicing elit. Placeat
                qui exercitationem delectus. Lorem ipsum dolor sit amet
                consectetur adipisicing elit. Placeat qui exercitationem
                delectus. Lorem ipsum dolor sit amet consectetur adipisicing
                elit. Placeat qui exercitationem delectus. Lorem ipsum dolor sit
                amet consectetur adipisicing elit. Placeat qui exercitationem
                delectus.
              </Desc>
            </Parallex>
          </Info>
        </Left>
        <Right>
          <Root/>
        </Right>
      </Container>
  )
}

export default Ourservice
